function base64ToURI(base64String) {
    return "data:image/png;base64," + base64String;
}

var defaultSmileyTable = {"\\blol\\b|\\bLOL\\b": base64ToURI(imgLol),
                          ":-?\\)+": base64ToURI(imgHappy),
                          ":-?\\(+": base64ToURI(imgOhNo),
                          "[:;]-?[pP]+\\b": base64ToURI(imgLick),
                          "[:;]'\\(+": base64ToURI(imgCry),
                          ";-?\\)+": base64ToURI(imgWink),
                           ";-?[dD]\\b": base64ToURI(imgWink),
                          ":-?D+\\b": base64ToURI(imgSoMuchWin),
                          "[xX][-']?D+\\b": base64ToURI(imgGrin),
                          ":-?/+": base64ToURI(imgErr),
                          ":-?\\?+": base64ToURI(imgHmmm),
                          "\\^_\\^": base64ToURI(imgCyoot),
                          "\\b[oO]_[oO]\\b": base64ToURI(imgStareDad),
                          ":-?\\@+": base64ToURI(imgFuu),
                          "\\b[fF]+[uU][uU]+\\b": base64ToURI(imgFuu),
                          "\\b[Yy] [Uu] [Nn][Oo] ": base64ToURI(imgYUNo),
                          "\\bfap fap( fap)+\\b": base64ToURI(imgFap),
                          "&lt;/troll(ing)?&gt;": base64ToURI(imgTroll),
                          ":-?7": base64ToURI(imgTroll),
                          ":-?\\|": base64ToURI(imgPoker),
                          "ME GUSTA": base64ToURI(imgMeGusta),
                          ":-?C": base64ToURI(imgBigFrown)};


var SmileyParser = function(smileyTable) { this.init(smileyTable); };
(function ()
 {
     this._smileyTable = {};
     this.init = function(smileyTable) {
         this._smileyTable = smileyTable || defaultSmileyTable;
         this._handlers = [];
         for (var smiley in this._smileyTable) {
             if (this._smileyTable.hasOwnProperty(smiley)) {
                 var self = this;
                 this._handlers.push({pattern: new RegExp('(["a-zA-Z0-9#])?' + smiley, "g"),
                                      replacement: (function (s) {
                                        return function(text, lb) {
                                          if (lb) return document.createTextNode(text);
                                          var img =
                                              document.createElement('img');
                                          img.src = self._smileyTable[s];
                                          img.alt = img.title =
                                            text.replace(/&/g, '&amp;').
                                                         replace(/</g, '&lt;').
                                                         replace(/>/g, '&gt;');
                                          return img;
                                        };
                                      })(smiley)});
             }
         }
     };

     this.parseSmileys = function(element) {
         replaceTextWithElements(element, {excludedTags: /textarea/,
                                           handlers: this._handlers});
     };
 }).call(SmileyParser.prototype);
 
 /**
* Recursively applies handlers to text nodes.
*
* @param {Element} element root element where to start the conversion
* @param {Object} options
* @param {RegExp} options.excludedTags HTML elements to be excluded
* @param {Handler[]} options.handlers handlers to be applied
*/
function replaceTextWithElements(element, options) {
    if (options.excludedTags.test(element.tagName)) {
        return;
    }
    var nodes = element.childNodes;
    for (var i = 0; i < nodes.length; ++i) {
        var node = nodes.item(i);
        if (node instanceof window.Element) {
            replaceTextWithElements(node, options);
        }
        else if (node instanceof window.Text) {
            var subNodes = splitTextNode(node, options);
            if (subNodes.length > 0) {
                for (var j = 0; j < subNodes.length; ++j) {
                    element.insertBefore(subNodes[j], node);
                }
                element.removeChild(node);
                i += subNodes.length;
            }
        }
    }
}

/**
* @private
*/
function splitTextNode(textNode, options) {
    var nodes = [textNode];
    for (var i = 0; i < options.handlers.length; ++i) {
        var handler = options.handlers[i];
        for (var j = 0; j < nodes.length; ++j) {
            var node = nodes[j];
            if (node instanceof window.Text) {
                var splitNodes = splitTextNodeByHandler(node, handler);
                if (splitNodes.length > 0) {
                    nodes.splice.apply(nodes, [j, 1].concat(splitNodes));
                    j += splitNodes.length;
                }
            }
        }
    }
    if ((nodes.length == 1) && (nodes[0] === textNode)) {
        return [];
    }
    else {
        return nodes;
    }
}

/**
* @private
*/
function splitTextNodeByHandler(textNode, handler) {
    var separator = '\0';
    var matches = [];
    var nodes = [];
    var textParts = textNode.nodeValue.replace(handler.pattern, function () {
        matches.push(handler.replacement.apply(handler, arguments));
        return separator;
    }).split(separator);
    if (matches.length == 0) {
        return nodes;
    }
    while (textParts.length > 0) {
        var text = textParts.shift();
        var match = matches.shift();
        if (text.length > 0) {
            nodes.push(document.createTextNode(text));
        }
        if (match instanceof Array) {
            nodes.push.apply(nodes, match);
        }
        else if (match != undefined) {
            nodes.push(match);
        }
    }
    return nodes;
}